"use strict";(self.webpackChunkdevyuseon_github_io=self.webpackChunkdevyuseon_github_io||[]).push([[880],{8256:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"/2024/02/04/troubleshooting-express-no-response","metadata":{"permalink":"/blog/2024/02/04/troubleshooting-express-no-response","source":"@site/blog/2024-02-04-troubleshooting-express-no-response.md","title":"[TroubleShooting] express\uac00 \uc751\ub2f5\uc744 \ubcf4\ub0b4\uc9c0 \uc54a\uc558\ub2e4. \uc65c..?","description":"\uc5d0\ub7ec\uac00 \ubc1c\uc0dd\ud558\uc9c0 \uc54a\uc558\ub294\ub370, \ud074\ub77c\uc774\uc5b8\ud2b8\ub294 \uc11c\ubc84\uc758 \uc751\ub2f5\uc744 \ubc1b\uc9c0 \ubabb\ud588\ub2e4. \uc774\uc720\ub97c \ucc3e\uc544\ubcf4\uc790 !","date":"2024-02-04T00:00:00.000Z","formattedDate":"February 4, 2024","tags":[{"label":"troubleshooting","permalink":"/blog/tags/troubleshooting"},{"label":"express","permalink":"/blog/tags/express"},{"label":"nginx","permalink":"/blog/tags/nginx"}],"readingTime":6.91,"hasTruncateMarker":true,"authors":[{"name":"yuseonLim","title":"BackEnd Engineer","url":"https://github.com/devyuseon","imageURL":"https://avatars.githubusercontent.com/u/67352902?v=4","key":"yuseonLim"}],"frontMatter":{"title":"[TroubleShooting] express\uac00 \uc751\ub2f5\uc744 \ubcf4\ub0b4\uc9c0 \uc54a\uc558\ub2e4. \uc65c..?","description":"\uc5d0\ub7ec\uac00 \ubc1c\uc0dd\ud558\uc9c0 \uc54a\uc558\ub294\ub370, \ud074\ub77c\uc774\uc5b8\ud2b8\ub294 \uc11c\ubc84\uc758 \uc751\ub2f5\uc744 \ubc1b\uc9c0 \ubabb\ud588\ub2e4. \uc774\uc720\ub97c \ucc3e\uc544\ubcf4\uc790 !","authors":"yuseonLim","tags":["troubleshooting","express","nginx"],"hide_table_of_contents":false},"unlisted":false,"nextItem":{"title":"\uc624\ud508\uc18c\uc2a4 \uccab \uae30\uc5ec \u2728","permalink":"/blog/2024/01/29/first-opensearch-contribute-docker-compose"}},"content":"## \ubb38\uc81c \uc0c1\ud669\\n\\n\ubb38\uc81c \uc0c1\ud669\uc774 \ubb34\uc5c7\uc778\uc9c0 \uc124\uba85\ud558\uae30 \uc804\uc5d0, \uc6b0\ub9ac \uc11c\ube44\uc2a4\ub294 \ud30c\uc77c\uc744 `\ub4f1\ub85d` \ud558\ub294 \uae30\ub2a5\uc774 \uc788\uace0, \ub611\uac19\uc740 \ud30c\uc77c\uc744 \uc911\ubcf5\uc73c\ub85c \ub4f1\ub85d\ud560 \uc218 \uc5c6\ub2e4. \uc911\ubcf5 \ub4f1\ub85d\uc744 \uc2dc\ub3c4\ud560 \uacbd\uc6b0\uc5d4 \uba54\uc138\uc9c0\uac00 \ub728\uba70 \ub4f1\ub85d\uc774 \uc548\ub41c\ub2e4.\\n\\n\uadf8\ub7f0\ub370 \uc0ac\uc6a9\uc790\ub85c\ubd80\ud130 \uc774\ub7f0 \uc5f0\ub77d\uc744 \ubc1b\uc558\ub2e4.\\n\\n> \ud30c\uc77c\uc744 \uc5c5\ub85c\ub4dc \ud558\uace0, `\ub4f1\ub85d` \ubc84\ud2bc\uc744 \ub20c\ub800\ub294\ub370 **\ub4f1\ub85d\uc5d0 \uc2e4\ud328** \ud588\ub2e4\ub294 \uba54\uc2dc\uc9c0\uac00 \ub5b4\uc2b5\ub2c8\ub2e4.<br/>\\n> \uadf8\ub798\uc11c \ub2e4\uc2dc \ub4f1\ub85d\uc744 \uc2dc\ub3c4\ud588\ub294\ub370, **\uc911\ubcf5 \ub4f1\ub85d** \uc774\ub77c\uace0 \ud558\uba70 \ub4f1\ub85d\uc774 \ub418\uc9c0 \uc54a\uc558\uc2b5\ub2c8\ub2e4. <br/>\\n> \ud655\uc778\ud574\ubcf4\ub2c8 \ucc98\uc74c\uc5d0 \ub4f1\ub85d\ud55c \ub9ac\ud3ec\ud2b8\uac00 \uc798 \ub4f1\ub85d\uc774 \ub418\uc5b4 \uc788\ub124\uc694?\\n\\n\uadf8\ub7ec\ub2c8\uae4c, \uc2e4\ud328\ud588\ub2e4\ub294 \uba54\uc138\uc9c0\uac00 \ub5b4\ub294\ub370 \uc2e4\uc81c\ub860 \uc131\uacf5\ud588\ub2e4\ub294 \uac70\ub2e4.\\n\\n\x3c!-- truncate --\x3e\\n\\n## \uc99d\uc0c1 \ud30c\uc545\\n\\n![](../static/img/post-img/diagram1.png)\\n\\n\ub4f1\ub85d \uae30\ub2a5 \ud504\ub85c\uc138\uc2a4\ub294 \uc774\ub807\ub2e4. express\uc5d0\uc11c \uc694\uccad\uc744 \uc804\ub2ec\ud558\uace0, spring\uc5d0\uc11c \ub4f1\ub85d \uacfc\uc815\uc744 \uc218\ud589\ud558\uace0, \uadf8\uac83\uc744 \ub2e4\uc2dc express\uc5d0 \ub118\uae30\uace0, express\ub294 \ud074\ub77c\uc774\uc5b8\ud2b8\uc5d0 \uc644\ub8cc\ub97c \uc804\ub2ec\ud55c\ub2e4.\\n\\n\ub85c\uadf8\ub97c \uc0b4\ud3b4\ubcf4\ub2c8, **express\uac00 client\ub85c \ub4f1\ub85d \uc644\ub8cc \uc804\ub2ec** \ud558\ub294 \ubd80\ubd84 \uc678\uc5d0\ub294 \ubaa8\ub450 success, 200\uc73c\ub85c \uc5d0\ub7ec \uc5c6\uc774 \uc798 \uc218\ud589\ub418\uc5c8\ub2e4.\\n\\n![](../static/img/post-img/diagram2.png)\\n\\n**express\uac00 client\ub85c \ub4f1\ub85d \uc644\ub8cc \uc804\ub2ec** \ud558\ub294 \ubd80\ubd84\uc740 ? \ub85c \ub0a8\uc558\ub2e4. \uc774\ub7f0 \ub85c\uadf8\ub97c \ubc1c\uacac\ud588\uae30 \ub54c\ubb38\uc774\ub2e4.\\n\\n```\\n[\uc2dc\uac04] \\"POST /api/*** HTTP/1.1\\" - - \\"\ucd9c\ucc98\\" \\"\ud074\ub77c\uc774\uc5b8\ud2b8 \uc815\ubcf4\\" - - ms\\n```\\n\\n\uc774 \ub85c\uadf8\ub294 express\uc758 [morgan](https://expressjs.com/en/resources/middleware/morgan.html) \ubbf8\ub4e4\uc6e8\uc5b4\uac00 \ub0a8\uae34 \ub85c\uadf8\uc774\ub2e4. \uc6d0\ub798\ub77c\uba74 \uc544\ub798\ucc98\ub7fc \uc751\ub2f5\uc2dc\uac04, \uc751\ub2f5\ud06c\uae30, \uac78\ub9b0\uc2dc\uac04\uc774 \ud45c\uc2dc \ub418\uc5b4\uc57c \ud55c\ub2e4.\\n\\n```\\n[\uc2dc\uac04] \\"POST /api/*** HTTP/1.1\\" 200 49 \\"\ucd9c\ucc98\\" \\"\ud074\ub77c\uc774\uc5b8\ud2b8 \uc815\ubcf4\\" - 317.922 ms\\n```\\n\\n\ubb54\uac00 \uc751\ub2f5\uc774 \uc815\uc0c1\uc801\uc73c\ub85c \ucc98\ub9ac\ub418\uc9c0 \uc54a\uc740 \ub4ef \ud588\ub2e4.\\n\\n\uadf8\ub7ec\ub098 \ubbf8\uc2a4\ud14c\ub9ac\uc778 \uc810\uc740 .. express\uac00 `await` \uc73c\ub85c spring\uc758 \uc751\ub2f5\uc744 \uae30\ub2e4\ub9ac\uace0, \uadf8 \ub4a4\uc5d0 \uc131\uacf5\ud588\uc744\ub550 \ub85c\uadf8\ub97c \ub0a8\uae30\uac8c \ub418\uc5b4 \uc788\ub294\ub370, \uadf8 \ub85c\uadf8\ub294 \ub0a8\uc558\ub2e4\ub294 \uac83\uc774\ub2e4.\\n\\nexpress\uc5d0 \uc5d0\ub7ec\ub294 \uc5c6\uc5c8\uace0, spring\uc5d0\ub3c4 \uc5d0\ub7ec\ub294 \uc5c6\uc5c8\ub294\ub370, \ud074\ub77c\uc774\uc5b8\ud2b8\uc5d0 \uc751\ub2f5 \uc804\uc1a1\ub9cc \uc815\uc0c1\uc801\uc73c\ub85c \ub418\uc9c0 \uc54a\uc558\ub2e4.\\n\\n\ucc3e\uc544\ubcf4\ub2c8, \uc704 -- \ub85c \ucc98\ub9ac\ub41c \ub85c\uadf8\ub294 express\uac00 \uc751\ub2f5 \uc790\uccb4\ub97c \ud558\uc9c0 \uc54a\uc558\uc744 \ub54c \uc77c\uc5b4\ub098\ub294 \uc77c\uc774\ub77c\uace0 \ud55c\ub2e4.\\n\\n> https://stackoverflow.com/questions/39728057/no-request-status-in-node-js-morgan-logging > https://github.com/expressjs/morgan/issues/121\\n\\n\uc704 \ub9c1\ud06c\uc5d0\uc11c \ucd94\uc815\ud55c \uc6d0\uc778\uc740 \ub2e4\uc74c\uacfc \uac19\ub2e4.\\n\\n:::tip[\uc544\ub9c8\ub3c4..]\\n\\nresponse\ub97c \ubcf4\ub0b4\uae30 \uc804\uc5d0 TCP \uc5f0\uacb0\uc774 \ub04a\uc5b4\uc9c4 \ub4ef!\\n\\n:::\\n\\n\ub85c\uadf8 \uc2dc\uac04\uc744 \ud30c\uc545\ud574\ubcf4\ub2c8 \ud074\ub77c\uc774\uc5b8\ud2b8 \uc694\uccad ~ spring\uc758 \uc751\ub2f5 \uae4c\uc9c0\ub294 1\ubd84 5\ucd08 \ub0b4\uc678\ub85c \uc18c\uc694\ub418\uc5c8\ub2e4.\\n\\n\uadf8\ub807\ub2e4\uba74 \uc5b4\ub514\uc11c TCP \uc5f0\uacb0\uc744 \ud574\uc81c\ud588\uc744\uae4c?\\n\\n## \uc6d0\uc778 \ud30c\uc545\\n\\n\ub0b4\uac00 \uc758\uc2ec\ud55c \uac83\ub4e4\uc740 \ub2e4\uc74c\uacfc \uac19\ub2e4.\\n\\n- axios timeout\\n- node.js timeout\\n- OS\uc758 TCP timeout\\n- L4 \uc2a4\uc704\uce58 timeout\\n- Nginx timeout\\n\\n### axios timeout\\n\\n\ub530\ub85c \uc124\uc815\ud55c \uac83\uc774 \uc5c6\ub2e4. [default\ub294 no timeout](https://github.com/axios/axios/blob/main/README.md#request-config) \uc774\ub2e4.\\n\\n### node.js timeout\\n\\n\ub178\ub4dc13 \ubc84\uc804 \uc774\ud6c4\ub85c\ub294 no timeout\uc774\ub2e4.\\n\\n\ub178\ub4dc8 \ubc84\uc804\uc744 \uc4f0\ub294 \uc6b0\ub9ac \ud504\ub85c\uc81d\ud2b8\ub294 120s\uac00 \uae30\ubcf8\uc73c\ub85c \uc124\uc815 \ub418\uc5b4 \uc788\ub2e4. (\ucc98\uc74c\uc54c\uc558\ub2e4 ..)\\n\\n> https://nodejs.org/api/http.html#servertimeout\\n\\n\uadf8\ub7ec\ub098 2\ubd84 \ubcf4\ub2e4 \uc624\ub798 \uac78\ub9ac\uc9c4 \uc54a\uc558\uc73c\ubbc0\ub85c \uc774\uac83\ub3c4 \uc544\ub2c8\ub2e4.\\n\\n### OS\uc758 TCP timeout\\n\\n```\\ncat /proc/sys/net/ipv4/tcp_keepalive_time\\n```\\n\\n- tcp_keepalive : tcp \uc5f0\uacb0\uc774 \ub418\uace0 \ub098\uc11c \uc5bc\ub9c8\ub098 \uadf8 \uc5f0\uacb0\uc744 \uc9c0\uc18d\ud558\ub294\uc9c0\\n\\n7200(2\uc2dc\uac04) \uc73c\ub85c \ub110\ub110\ud588\ub2e4.\\n\\n### L4 \uc2a4\uc704\uce58\\n\\nL4 \uc5d0\uc11c\ub3c4 \ubb54\uac00 \ud0c0\uc784\uc544\uc6c3\uc774 \uac78\ub824\uc788\ub294\uac83\uc740 \uc544\ub2d0\uae4c..? \ud558\uace0 \ud574\ub2f9 \uc0ac\ud56d\uc744 \uc778\ud504\ub77c\ud300\uc5d0 \ubb38\uc758\ud588\ub294\ub370\\n\\n\uc544\ub2c8\ub2e4. (~\uc758\uc2ec\ud574\uc11c \uc8c4\uc1a1\ud569\ub2c8\ub2e4...~)\\n\\n\uc804\uc5d0\ub3c4 L4 \uc124\uc815 \ubb38\uc81c\ub54c\ubb38\uc5d0 \uc548\ub41c \uae30\ub2a5\uc774 \uc788\uc5b4\uc11c, \uc0dd\uac01\ub0ac\uc5c8\ub294\ub370 .. \uc5b4\uca0c\ub4e0 \uc774\uac8c \ubb38\uc81c\ub294 \uc544\ub2c8\uc600\ub2e4.\\n\\n### Nginx timeout\\n\\n```nginx title=\\"/etc/nginx/nginx.conf\\"\\nkeepalive_timeout 65; // default 75\\n```\\n\\n\uc5ec\uae30\uc600\ub2e4 !!\\n\\nkeepalive_timeout\uc774 65\ucd08\ub85c \uc124\uc815 \ub418\uc5b4 \uc788\uc5c8\ub2e4. \uc9c0\uae08\uaecf Nginx \uc124\uc815\uc744 \ubc14\uafc0 \uc77c\uc774 \uc5c6\uc5b4\uc11c \uc790\uc138\ud788 \ub4e4\uc5ec\ub2e4 \ubcf4\uc9c0 \uc54a\uc544\uc11c \ubab0\ub790\ub2e4.\\n\\n\uc774 \uc0ac\uc2e4\uc744 \uc54c\uace0 \ub09c \ub4a4 nginx \uc5d0\ub7ec \ub85c\uadf8\ub97c \ubcf4\ub2c8 (\ub85c\uadf8 \uacbd\ub85c\ub294 nginx.conf \uc5d0 \uc788\ub2e4.)\\n\\n```text title=\\"error.log\\"\\n[error] upstream timed out (110: Connection timed out) while reading response header from upstream .. \uc0dd\ub7b5\\n```\\n\\nconnection timeout \uc5d0\ub7ec \ub85c\uadf8\uac00 \ucc0d\ud614\ub2e4.\\n\\nspring\uc774 express\ub85c \uc751\ub2f5\uc744 \ubcf4\ub0b4, express\uac00 client\uc5d0 \uc751\ub2f5\ud558\uae30 \uc804\uc5d0 client\uc640 express\uac04\uc758 \uc5f0\uacb0\uc774 \ub04a\uc5b4\uc838 client\uac00 \uc751\ub2f5\uc744 \ubc1b\uc9c0 \ubabb\ud55c \uac83\uc774\ub2e4.\\n\\n## \ud574\uacb0\\n\\n\ud574\uacb0 \ubc29\ubc95\uc73c\ub85c\ub294 \uc774\ub7f0 \uac83\ub4e4\uc774 \uc788\uaca0\ub2e4.\\n\\n- timeout \ub298\ub9ac\uae30\\n- upstream\uc778 spring \uc11c\ubc84\uc758 \ucc98\ub9ac \uc131\ub2a5 \ud5a5\uc0c1\ud558\uae30 (best)\\n\\n\uadf8\ub9ac\uace0 nginx \ub85c\uadf8\ub294 \ub3c4\ucee4 \ucee8\ud14c\uc774\ub108 \uc548\uc5d0 \uc788\uc5b4\uc11c, \ucee8\ud14c\uc774\ub108\uac00 \ub0b4\ub824\uac00\uba74 \ub85c\uadf8 \ud30c\uc77c\uc774 \ub0a0\uc544\uac00 \ubcfc \uc218 \uc5c6\ub2e4.\\n\ub3c4\ucee4 \ucee8\ud14c\uc774\ub108\uc5d0\uc11c \uc313\uc740 \ub85c\uadf8\ub294 volume\uc73c\ub85c \uc5f0\uacb0\ud574 host\uc5d0\ub3c4 \uc313\uac8c \ud574\ub1a8\ub2e4. nginx \ub85c\uadf8\ub3c4 \ud45c\uc900 \ucd9c\ub825\uc73c\ub85c \ub0b4\ubcf4\ub0b4 (/dev/stdout \uc73c\ub85c \uc2ec\ubcfc\ub9ad \ub9c1\ud06c \uac78\uae30) \ub3c4\ucee4\uac00 \ub85c\uadf8\ub97c \uc218\uc9d1\ud558\uac8c \ud558\uac70\ub098 nginx \ub85c\uadf8\ub97c volume\uc73c\ub85c \uc124\uc815\ud574 \ubcf4\uad00 \ud560 \ud544\uc694\uac00 \uc788\ub2e4.\\n\\n\uc77c\ub2e8 timeout\uc744 \ub298\ub824\uc11c \uae09\ud55c \ubd88\uc744 \ub044\uace0, spring \uc11c\ubc84\uc758 \ucc98\ub9ac \uc131\ub2a5\uc744 \ub192\uc77c \ubc29\ubc95\uc744 \uc0dd\uac01 \ud574 \ubcfc \uac83\uc774\ub2e4.\\n\\n\uc801\uace0\ubcf4\ub2c8 \ubcc4\uc77c \uc544\ub2cc \ub4ef \ud558\uc9c0\ub9cc,, \uc758\ubbf8 \uc788\uc5c8\ub358 \uacfc\uc815\uc774\uc600\ub2e4.\\n\\n\uc774 \uc774\uc288\ub85c \uc778\ud574 \uc6b0\ub9ac \uc11c\ube44\uc2a4\uc758 \uc5b4\ub5a4 \ubd80\ubd84\uc5d0 timeout\uc774 \uc5bc\ub9cc\ud07c \uac78\ub824\uc788\ub294\uc9c0 \ud655\uc778 \ud560 \uc218 \uc788\uc5c8\uace0, \ub85c\uadf8\ub3c4 \uc880 \ub354 \ubcf4\ucda9\ud560 \uc218 \uc788\uc5c8\ub2e4. \ub2e4\uc74c\uc5d0 \uc774\ub7ec\ud55c \uc77c\uc774 \ubc1c\uc0dd\ud558\uba74 \uc774 \uacbd\ud5d8\uc73c\ub85c \uc778\ud574 \uc6d0\uc778 \ud30c\uc545\uc744 \uc870\uae08\uc740 \ube68\ub9ac \ud560 \uc218 \uc788\uc744\uae4c \uae30\ub300\ud574\ubcf4\uba70 \uae00\uc744 \ub9c8\uce5c\ub2e4."},{"id":"/2024/01/29/first-opensearch-contribute-docker-compose","metadata":{"permalink":"/blog/2024/01/29/first-opensearch-contribute-docker-compose","source":"@site/blog/2024-01-29-first-opensearch-contribute-docker-compose.md","title":"\uc624\ud508\uc18c\uc2a4 \uccab \uae30\uc5ec \u2728","description":"\uc5d0\ub7ec\uac00 \ubc1c\uc0dd\ud558\uc9c0 \uc54a\uc558\ub294\ub370, \ud074\ub77c\uc774\uc5b8\ud2b8\ub294 \uc11c\ubc84\uc758 \uc751\ub2f5\uc744 \ubc1b\uc9c0 \ubabb\ud588\ub2e4. \uc774\uc720\ub97c \ucc3e\uc544\ubcf4\uc790 !","date":"2024-01-29T00:00:00.000Z","formattedDate":"January 29, 2024","tags":[{"label":"docker","permalink":"/blog/tags/docker"},{"label":"opensource-contributions","permalink":"/blog/tags/opensource-contributions"}],"readingTime":1.925,"hasTruncateMarker":true,"authors":[{"name":"yuseonLim","title":"BackEnd Engineer","url":"https://github.com/devyuseon","imageURL":"https://avatars.githubusercontent.com/u/67352902?v=4","key":"yuseonLim"}],"frontMatter":{"title":"\uc624\ud508\uc18c\uc2a4 \uccab \uae30\uc5ec \u2728","description":"\uc5d0\ub7ec\uac00 \ubc1c\uc0dd\ud558\uc9c0 \uc54a\uc558\ub294\ub370, \ud074\ub77c\uc774\uc5b8\ud2b8\ub294 \uc11c\ubc84\uc758 \uc751\ub2f5\uc744 \ubc1b\uc9c0 \ubabb\ud588\ub2e4. \uc774\uc720\ub97c \ucc3e\uc544\ubcf4\uc790 !","authors":"yuseonLim","tags":["docker","opensource-contributions"],"hide_table_of_contents":false},"unlisted":false,"prevItem":{"title":"[TroubleShooting] express\uac00 \uc751\ub2f5\uc744 \ubcf4\ub0b4\uc9c0 \uc54a\uc558\ub2e4. \uc65c..?","permalink":"/blog/2024/02/04/troubleshooting-express-no-response"},"nextItem":{"title":"[Java] \uc5d0\ub7ec \uba54\uc2dc\uc9c0, Stacktrace\uac00 \uc0dd\ub7b5\ub418\ub294 \ubb38\uc81c","permalink":"/blog/2024/01/02/java-no-stacktrace"}},"content":"\ube44\ub85d \uacf5\uc2dd\ubb38\uc11c\uc758 \uc624\ub958\ub97c \uace0\uce58\ub294 \uc77c\uc774\uc600\uc9c0\ub9cc,\\n\\n\ucc98\uc74c\uc73c\ub85c \uc624\ud508\uc18c\uc2a4\uc5d0 \uae30\uc5ec\ud588\uace0 \ubb34\ub824 Docker \ubb38\uc11c \uc774\ub2e4!!\\n\\n\uba38\uc9c0 \ub418\uc5c8\uc744\ub54c\ub294 \uc815\ub9d0 \ubfcc\ub4ef\ud588\uace0 \uc774\uc288\ub97c \uc0dd\uc131\ud558\uace0 PR\uc744 \ub0a0\ub9ac\ub294 \uacfc\uc815\ub3c4 \uc7ac\ubc0c\uc5c8\ub2e4.\\n\\n\x3c!-- truncate --\x3e\\n\\n## \ubb38\uc81c \ubc1c\uacac, \uc774\uc288 \uc0dd\uc131\\n\\n![](../static/img/post-img/20240205204509.png)\\n\\n\ubb38\uc11c\uc5d0 \ud2c0\ub9b0 \ubd80\ubd84\uc744 \ubc1c\uacac\ud558\uace0, \uc774\uc288\ub97c \uc0dd\uc131\ud588\ub2e4.\\n\\n\uc218\uc815\uc774 \ud544\uc694\ud55c\uac8c \ub9de\ub2e4\uba74 \ub0b4\uac00 \uc791\uc5c5\ud574\ub3c4 \ub418\ub294\uc9c0 \ubb3c\uc5b4\ubd24\ub2e4.\\n\\n![](../static/img/post-img/20240205204536.png)\\n\\nassgin \ud574\uc8fc\uc168\uace0, \ubb38\uc11c \uc704\uce58\uac00 \ubc14\ub00c\uc5c8\uc73c\ub2c8 compose-spec \ub808\ud3ec\uc9c0\ud1a0\ub9ac\uc5d0\uc11c PR\uc744 \ud574\ub2ec\ub77c\ub294 \uce5c\uc808\ud55c \uac00\uc774\ub4dc\uae4c\uc9c0 \uc8fc\uc168\ub2e4.\\n\\n## Pull Request \uc0dd\uc131\ud558\uae30\\n\\n\uba3c\uc800 compose-spec\uc744 fork\ud558\uace0, \uc18c\uc2a4\ucf54\ub4dc \uc218\uc815 \ud6c4 commit \ud588\ub2e4.\\n\\n![](../static/img/post-img/20240205204610.png)\\n\\n\ub2e4\uc2dc upstream\uc73c\ub85c\xa0\uc640\uc11c pull request\ub97c \uc0dd\uc131\ud588\ub2e4.\\n\\n![](../static/img/post-img/20240205204624.png)\\n\\n\uc774\uac74 \ub0b4\uac00 CONTRIBUTING.md\ub97c \uaf3c\uaf3c\ud788 \ubcf4\uc9c0 \uc54a\uc544 \uc0dd\uae34 \uc77c\uc774\ub2e4. \u315c\u315c\\n\\n\uadf8\ub0e5 \ucee4\ubc0b\ud560\ub54c \uacc4\uc815 \uc815\ubcf4\ub97c \ud655\uc778\ud574\ub2ec\ub77c\ub294 \ub9d0\uc778 \uc904 \uc54c\uc558\ub294\ub370,\\n\\n\ucee4\ubc0b \uba54\uc138\uc9c0\uc5d0 sign-off\ub97c \ud3ec\ud568\ud558\uc9c0 \uc54a\uc73c\uba74 DCO check\uc5d0 \uc2e4\ud328 \ud558\uba74\uc11c \uc624\ub958\uac00 \ub09c\ub2e4.\\n\\n\uce5c\uc808\ud788 \uc54c\ub824\uc8fc\uc154\uc11c \ucee4\ubc0b \uba54\uc138\uc9c0 \uc218\uc815 \ud6c4 \uac15\uc81c \ud478\uc2dc\ud588\uace0,\\n\\n\uc774\ud6c4 \ube4c\ub4dc\uc5d0 \ud55c \ubc88 \uc2e4\ud328\ud574 \ud55c\uac00\uc9c0 \uc218\uc815\uc744 \ub354 \ud558\uace0 \uba38\uc9c0\ub418\uc5c8\ub2e4.\\n\\n![](../static/img/post-img/20240205204639.png)\\n\\n![](../static/img/post-img/20240205204646.png)\\n\\n\uc774\ub807\uac8c\xa0\uc624\ud508\uc18c\uc2a4 \uae30\uc5ec\uc5d0 \uc791\uc9c0\ub9cc \uc704\ub300\ud55c \uccab \uac78\uc74c\uc744 \ub0b4\ub51b\uc5c8\ub2e4.\\n\\n\uc55e\uc73c\ub85c\ub3c4 \ubb38\uc11c \ubfd0\ub9cc \uc544\ub2c8\ub77c \ucf54\ub4dc \ub808\ubca8\uae4c\uc9c0 .. \ub354 \ub9ce\uc740 \uc624\ud508\uc18c\uc2a4\uc5d0 \uae30\uc5ec\ud560 \uc218 \uc788\uac8c \ub418\uba74 \uc88b\uaca0\ub2e4."},{"id":"/2024/01/02/java-no-stacktrace","metadata":{"permalink":"/blog/2024/01/02/java-no-stacktrace","source":"@site/blog/2024-01-02-java-no-stacktrace.md","title":"[Java] \uc5d0\ub7ec \uba54\uc2dc\uc9c0, Stacktrace\uac00 \uc0dd\ub7b5\ub418\ub294 \ubb38\uc81c","description":"NullPointerException\uc758 \uc5d0\ub7ec \uba54\uc2dc\uc9c0\uac00 \ube48 \ucc44\ub85c \ucd9c\ub825\ub41c\ub2e4","date":"2024-01-02T00:00:00.000Z","formattedDate":"January 2, 2024","tags":[{"label":"java","permalink":"/blog/tags/java"}],"readingTime":4.155,"hasTruncateMarker":true,"authors":[{"name":"yuseonLim","title":"BackEnd Engineer","url":"https://github.com/devyuseon","imageURL":"https://avatars.githubusercontent.com/u/67352902?v=4","key":"yuseonLim"}],"frontMatter":{"title":"[Java] \uc5d0\ub7ec \uba54\uc2dc\uc9c0, Stacktrace\uac00 \uc0dd\ub7b5\ub418\ub294 \ubb38\uc81c","description":"NullPointerException\uc758 \uc5d0\ub7ec \uba54\uc2dc\uc9c0\uac00 \ube48 \ucc44\ub85c \ucd9c\ub825\ub41c\ub2e4","authors":"yuseonLim","tags":["java"]},"unlisted":false,"prevItem":{"title":"\uc624\ud508\uc18c\uc2a4 \uccab \uae30\uc5ec \u2728","permalink":"/blog/2024/01/29/first-opensearch-contribute-docker-compose"}},"content":"## \ubb38\uc81c \uc0c1\ud669\\n\\n\ud14c\uc2a4\ud2b8 \uc2a4\ud06c\ub9bd\ud2b8\ub97c \ubc30\ud3ec\uc2dc\uc5d0 \uc2e4\ud589\ud558\uac8c \ub418\uc5b4 \uc788\ub294\ub370, \ud574\ub2f9 \uc2a4\ud074\ub9bd\ud2b8\ub294 \uac19\uc740 api\ub97c \uc5ec\ub7ec case\ub85c \uba87\uc2ed\ubc88 \ud638\ucd9c\ud55c\ub2e4.\\n\\n\ucd5c\ucd08 \uc2e4\ud589\uc2dc\uc5d0\ub294 \uc131\uacf5\ud558\uace0,\\n\\n\ub450\ubc88\uc9f8 \uc774\ud6c4\ubd80\ud134 \uc2e4\ud328\ud55c\ub2e4.\\n\\n\x3c!-- truncate --\x3e\\n\\n\uc9c0\uae08\uae4c\uc9c0\ub294 \uc11c\ube44\uc2a4 \uc2e4\ud589\uc2dc \ud55c\ubc88\ub9cc \uc2e4\ud589\ud588\uc5b4\uc11c \ubc1c\uacac\uc744 \ubabb \ud55c \ubb38\uc81c\uc600\ub2e4.\\n\\n\uc5d0\ub7ec\uac00 \ubc1c\uc0dd\ud55c \uc9c0\uc810\uc740 \uc5ec\uae30\uc600\ub2e4.\\n\\n```java\\ncatch (Exception e) {\\n    String msg = e.getMessage(); // errMsg: null\\n    if (msg.equalsIgnoreCase(\\"XXX\\")) { // NullPointerException \ubc1c\uc0dd!\\n        //\\n    }\\n}\\n```\\n\\ntry ~ catch \ubb38\uc5d0\uc11c \uc5d0\ub7ec \uba54\uc138\uc9c0\ub97c \uac00\uc838\uc640 \uc5b4\ub5a4 \uc5d0\ub7ec \uba54\uc2dc\uc9c0\uc778\uc9c0 \ud310\ub2e8\ud558\ub824\uace0 \ud560 \ub54c, `e.getMessage()` \uacb0\uacfc\uac00\xa0**null**\xa0\uc774 \ub418\uc5b4 catch \uad6c\ubb38\uc5d0\uc11c \ub2e4\uc2dc \uc5d0\ub7ec\uac00 \ubc1c\uc0dd\ud558\ub294 \uac83\uc774\uc600\ub2e4.\\n\\n\ub85c\uc9c1\uc744 \uc0b4\ud3b4\ubcf4\ub2c8 \ud2b9\uc815 case\uc5d4 \ubb34\uc870\uac74 try\ucabd\uc5d0\uc11c NPE\uac00 \ubc1c\uc0dd\ud558\uace0, catch\ubb38\uc73c\ub85c \ub4e4\uc5b4\uc624\uac8c \ub418\uc5b4\uc788\uc5c8\ub2e4.\\n\\n\uadfc\ub370 \uc65c \ucd5c\ucd08 \uc2e4\ud589\uc2dc\uc5d4 msg\uac00 null\uc774 \uc544\ub2cc\uac00..???!!!\\n\\n\ud574\ub2f9 \ud604\uc0c1\uc744 \uc7ac\ud604\ud55c \ub4a4\uc5d0 \ucd5c\ucd08 \uc2e4\ud589 / \uc774\ud6c4 \uc2e4\ud589\uc5d0 \ub300\ud55c \uc5d0\ub7ec\ub97c \ucd9c\ub825\ud574 \ubcf4\uc558\ub2e4.\\n\\n**\ucd5c\ucd08**\\n\\n```\\nclass java.lang.NullPointerException: Cannot invoke \\"Object.toString()\\" because of \\"java.util.Map.get(Object) is null\\n// \uad49\uc7a5\ud788 \uae34 StackTrace\\n```\\n\\n**\ub450\ubc88\uc9f8~**\\n\\n```java\\nclass java.lang.NullPointerException: null\\n```\\n\\n\ub098\ub294 \ub0b4\uac00 \ub85c\uc9c1 \uc5b4\ub518\uac00\uc5d0 NPE\uac00 \ubc1c\uc0dd\ud558\ub294 \uc6d0\uc778\uc744 \ub193\uce5c\uc904 \uc54c\uace0 \uba70\uce60\uc744 \uc0bd\uc9c8\ud588\ub294\ub370, \uc2a4\ud0dd\uc624\ubc84\ud50c\ub85c\uc6b0\uc5d0\uc11c \uc774 \uae00\uc744 \ubc1c\uacac\ud588\ub2e4.\\n\\n> https://stackoverflow.com/questions/2411487/nullpointerexception-in-java-with-no-stacktrace\\n\\n\uad00\ub828\ud574\uc11c \uac04\ub7b5\ud558\uac8c\xa0\uc870\uc0ac\ud574 \ubcf4\uc558\ub2e4.\\n\\n## JVM Stacktrace \uc0dd\ub7b5\\n\\n[JDK5 \ub9b4\ub9ac\uc988 \ub178\ud2b8](https://www.oracle.com/java/technologies/javase/release-notes-introduction.html)\ub97c \ubcf4\uba74 Exception\uc774 \ubc18\ubcf5\uc801\uc73c\ub85c \ubc1c\uc0dd\ud560 \ub54c, \ucef4\ud30c\uc77c\ub7ec\ub294 StackTrace\ub97c \ucd9c\ub825\ud558\ub294\uac83\uc744 \uba48\ucd98\ub2e4\uace0 \ud55c\ub2e4.\\n\\n\uc774\uac83\uc740 JVM\uc758 JIT\ucef4\ud30c\uc77c\ub7ec\uc758 C2\ucef4\ud30c\uc77c\ub7ec\uc758 \uae30\ubcf8 \ucd5c\uc801\ud654 \uc635\uc158 \uc774\ub77c\uace0 \ud55c\ub2e4.\\n\\n[OpenJDK\uc758 \uc18c\uc2a4 \ucf54\ub4dc](https://github.com/openjdk/jdk/blob/master/src/hotspot/share/opto/graphKit.cpp#L528)\ub97c \ubcf4\uba74 \ub2e4\uc74c \ub2e4\uc12f\uac00\uc9c0 Exception\uc5d0 \ub300\ud574 \ucd5c\uc801\ud654 \uc635\uc158\uc774 \uc801\uc6a9\ub41c\ub2e4.\\n\\n:::info\\n\\n**Stacktrace \uc0dd\ub7b5 \ucd5c\uc801\ud654 \uc635\uc158 \uc801\uc6a9\ub418\ub294 Exception**\\n\\n- NullPointerException\\n- ArithmeticException\\n- ArrayIndexOutOfBoundsException\\n- ClassCastException\\n- ArrayStoreException\\n\\n:::\\n\\n![](../static/img/post-img/20240205210954.png)\\n\\n\ucd5c\uc801\ud654 \uc635\uc158\uc744 \ube44\ud65c\uc131\ud654 \ud558\ub824\uba74 \uc544\ub798 JVM \uc635\uc158\uc744\xa0\ucd94\uac00\ud574 \uc8fc\uba74 \ub41c\ub2e4.\\n\\n```\\n-XX:-OmitStackTraceInFastThrow\\n```\\n\\n\ud558\uc9c0\ub9cc \uc774\ub294 \uc131\ub2a5 \ucd5c\uc801\ud654\ub97c \uc704\ud55c \uc635\uc158\uc73c\ub85c, \ud574\ub2f9 Exception\uc774 \ubc18\ubcf5\uc801\uc73c\ub85c \uc77c\uc5b4\ub098\uc9c0 \uc54a\uac8c\ub054 \ucc98\ub9ac \ud558\ub294\uac83\uc774 \uc62c\ubc14\ub978 \ubc29\ud5a5 \uc77c \uac83\uc774\ub2e4.\\n\\nException \ucc98\ub9ac\uc5d0 \ub300\ud55c \ucd5c\uc801\ud654\ub97c \ud558\ub294 \uc774\uc720\uac00 \uad81\uae08\ud574\uc11c \ucc3e\uc544\ubcf4\uc558\ub2e4.\\n\\nJava\uc5d0\uc11c Exception\uc744 \ub358\uc9c0\ub294 \ube44\uc6a9\uc740 \uaf64 \ube44\uc2f8\ub2e4\uace0 \ud55c\ub2e4. Exception\uc774 \ubc1c\uc0dd\ud558\uba74 \ud574\ub2f9 \uc608\uc678\uac00 \uc5b4\ub514\uc11c \ubc1c\uc0dd\ud588\ub294\uc9c0 \ucd94\uc801\ud558\uba70 \uc815\ubcf4\ub97c \uc218\uc9d1\ud558\uace0 Stack Trace\ub97c \uc0dd\uc131\ud55c\ub2e4. \uc774\ub97c \uacc4\uc0b0\ud558\ub294\ub370\uc5d0\ub3c4 \uc2dc\uac04\uc774 \uaf64 \uac78\ub9b0.\\n\\n\ub610, \uc608\uc678 \uac1d\uccb4\ub97c \uc0c8\ub85c \uc0dd\uc131\ud558\uace0 \ucd08\uae30\ud654 \ud558\ub294 \uacfc\uc815\uc774 \ubc18\ubcf5\ub418\uae30 \ub54c\ubb38\uc5d0 \uc88b\uc9c0 \uc54a\ub2e4. \uadf8\ub9ac\uace0 Exception\uc774 \ubc1c\uc0dd\ud558\uba74 \uadf8\uac83\uc774 \uc5b4\ub5a4 \uc608\uc678\uc778\uc9c0 \uc801\uc808\ud55c \uc608\uc678 \ud578\ub4e4\ub7ec\ub97c \ucc3e\uc544 \ub9ac\ud134\ud574\uc918\uc57c \ud558\ub294\ub370, \uc608\uc678 \ud578\ub4e4\ub7ec\ub97c \ucc3e\ub294 \uacfc\uc815 \ub610\ud55c \uc624\ub798 \uac78\ub9b0\ub2e4.\\n\\n\ud504\ub85c\uc81d\ud2b8\ub97c \ud560 \ub54c\ub3c4, \uc801\uc808\ud55c \uc608\uc678 \uc0c1\ud669\uc5d0 Custom Exception\uc744 \ub358\uc9c0\uace4 \ud588\ub294\ub370, \uc774\uac8c \ub9de\ub294 \ubc29\ubc95\uc778\uc9c0 \uc0dd\uac01\ud574\ubcfc \ud544\uc694\uac00 \uc788\ub294 \ub4ef \ud558\ub2e4.\\n\\n\uadf8\ub9ac\uace0 \uc2a4\ud0dd \ucd94\uc801\uc774 \ud544\uc694\ud558\uc9c0 \uc54a\uc740 \uacbd\uc6b0\ub77c\uba74 override\ub97c \ud1b5\ud574 trace\ub97c \ub2f4\uc9c0 \uc54a\ub3c4\ub85d \ud558\ub294 \ubc29\ubc95\ub3c4 \uc88b\uaca0\ub2e4."}]}')}}]);